 ('2', '2', 'en_us', 'Home', '<p>If you are a high school student planning your future, then Kent Roosevelt Career Technical programs is the place for you!  Learn in our high-tech facility from instructors with real-world experience. The Kent Roosevelt High School Career Technical programs are open to students within the Six District Educational Compact. </p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, 'This is information about when we\'re accepting applications and why you should apply today.', 'How To Apply', NULL, NULL, NULL, '1', 'News', 'Explore Pathways', 'Welcome to Kent Roosevelt', NULL, NULL, NULL, NULL, 'Career Technical Education', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-04-18 15:33:03', '2017-09-04 21:24:42', '35ea2da5-4e56-4a77-aca1-2b79c89ab6b8'),
 ('3', '3', 'en_us', 'We just installed Craft!', '<p>Craft is the CMS that’s powering Careertech.web. It’s beautiful, powerful, flexible, and easy-to-use, and it’s made by Pixel &amp; Tonic. We can’t wait to dive in and see what it’s capable of!</p>\n<!--pagebreak-->\n<p>This is even more captivating content, which you couldn’t see on the News index page because it was entered after a Page Break, and the News index template only likes to show the content on the first page.</p>\n<p>Craft: a nice alternative to Word, if you’re making a website.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, '2017-09-14 04:00:00', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-04-18 15:33:03', '2017-09-04 18:16:17', '6e8a8219-d4b2-414f-83b2-2e7ea4c30de9'),
