 ('89', '96', 'en_us', 'Tom Franek', '<p>As an instructor of  Forestry and Landscape Management for 16 years at Kent Theodore Roosevelt High School, I\'ve enjoyed the mix of teaching new skills and knowledge along with providing the ability to apply these skills and knowledge on real job sites in the community.   It provides for a very fulfilling career.</p>\n<p>I believe that careers related to this field provide and promote an active, healthy and happy lifestyle and a very high quality of life.  As part of the program, I advocate living healthy by emphasizing safe working habits, proper diet and sleep habits, and involvement in activities that promote fitness.</p>', NULL, NULL, NULL, 'needed', NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, 'ke_tfranek@kentschools.net', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-06-27 17:33:59', '2017-08-07 17:16:04', '56869bf1-73c5-4577-a819-975e2146673d'),
